script:
return {
    filter: function( value, resolve, reject ) {
        var data = value.get();
        data.keywords = JSON.parse("["+data.keywords+"]");
        var query ={action:"create",kind:"project","data":data};
        resolve(query);
    }
};

return {
    filter: function( value, resolve, reject ) {
        var project = value.get();
        if(project._ch&&project._ch.length>0){
            var lng = project._ch.length;
            var kind = project._ch[0].kind;
            var values = new Array(lng);
            for(var i=0;i<project._ch.length;i++){
                values[i]=project._ch[i].id
            }
            var query ={"action":"find","kind":kind,"field":"_id","values":values};
            resolve(query);
        }
    }
};

return {
    filter: function( value, resolve, reject ) {
        var patient = value.get();
        if(patient._ch&&patient._ch.length>0){
            var query ={"action":"getChildren","kind":"patient","_id":patient._id,"params":{"groupKind":true}};
            resolve(query);
        }
    }
};

return {
    filter: function( value, resolve, reject ) {
        var patient = value.get();
        if(patient._ch&&patient._ch.length>0){
            var query ={"action":"getChildren","kind":"urine","_id":patient._id};
            resolve(query);
        }
    }
};

return {
    filter: function( value, resolve, reject ) {
        var entry = value.get();
        var query = null;
        if(entry._id)
            query ={"action":"getFile","kind":"jcamp","_id":entry._id};
        resolve(query);
    }
};
